var space_release = func nil;
var space = func(state, mod) {
    if (!state) {
        space_release();
        return space_release = func nil;
    }
    if (mod == 0 or mod == 1) {
        controls.ptt(mod + 1);
        space_release = func controls.ptt(0);
    }
}

